script: |
  super -f text -I q11520.spq | sort > q11520.out

inputs:
  - name: q11520.spq
    data: |
      SELECT DISTINCT + col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL IN ( - 64, + 38 + - + 98 - + col1 * + col1 * - + col0 + + col0 - + 56 * - col1 * + + col1 - col2 * + - col2, + col0 );
  - name: tab0

outputs:
  - name: q11520.out
    data: |
